import MenuBar from '../Home/MenuBar';
import ButtonCard from '../Home/ButtonCard';

function HomePage() {
  return (
    <div className="bg-gradient-to-b from-gray-100 to-gray-200 min-h-screen">
      <div className="fixed inset-0 bg-noise"></div>
      <MenuBar />
      <div className="container mx-auto mt-8">
        <div className="grid grid-cols-2 gap-4">
          <ButtonCard title="Account" icon="fas fa-user" />
          <ButtonCard title="Loan" icon="fas fa-money-bill-wave" />
          <ButtonCard title="Credit Card" icon="fas fa-credit-card" />
          <ButtonCard title="Bills" icon="fas fa-file-invoice-dollar" />
          <ButtonCard title="Transfers" icon="fas fa-exchange-alt" />
          <ButtonCard title="Contact Us" icon="fas fa-phone" />
        </div>
      </div>
    </div>
  );
}

export default HomePage;
